import React from 'react'
import '../../Style/PostAdd.css'

function PostAdd({createProcess,setName,setCode,setWeight}) {
    function ChangeName(event){
        setName(event.target.value);
    }
    function ChangeCode(event){
        setCode(event.target.value);
    }
    function ChangeWeight(event){
        setWeight(event.target.value)
    }
    return (
        <div className='postbody-box-right-back'>
            <div className='postbody-box-right-title'>
                Add Infomation
            </div>
            <div className='postbody-box-right-content'>
                <div>
                    <input className='postbody-input' placeholder="ProductName" onChange={ChangeName}/>
                </div>
                <div>
                    <input className='postbody-input' placeholder="Code" onChange={ChangeCode}/>
                </div>
                <div>
                    <input className='postbody-input' placeholder="Weight"/>
                </div>
                <button className='postbody-button'>Send</button>
            </div>
        </div>
    )
}

export default PostAdd
